import axios from 'axios';
import actions from './actions';

const { resetPassword } = actions;

const reset = (password, token) => {
    return async dispatch => {
        try {
            const response = await axios.post(`https://api.develocity.finance/api/v1/admin/resetPassword/${token}`, {
                password,
            });
            
            dispatch(resetPassword(response.data));
        } catch (err) {
            console.log(err);
        }
    };
};

export { reset };
